import logo from './../assets/ucc-logo.png'

const Navbar = () =>{
    return(
        <div className="navbar">
                <div>
                    <img width="40" src={logo}/>
                    <span>internship ucc</span>
                </div>
                <div className="tabs">
                    <a href="#">DEPARTMENTS</a>
                    <a href="#">REVIEW</a>
                    <a href="#">DEPARTMENTS</a>
                </div>
        </div>
    )
}

export default Navbar;
